p{
    font-family: Arial;
    margin-top: 0;
    margin-bottom: 0;   
}

.video-stats{
    font-size: 14px;
    color: rgb(96, 96, 96);
    margin-bottom: 20px;   
    background-color: yellow;
}

.video-title {
    font-weight: bold;
    font-size: 18px;
    width: 280px;
    line-height: 24px;
    margin-bottom: 5px ;

    background-color: red;
}

.video-author {
    font-size: 18px;
    color: rgb(96, 96, 96);
    margin-bottom: 20px ;
    background-color: green;
}

.video-description {
    font-size: 14px;
    color: rgb(96, 96, 96);
    width: 280px;
    line-height: 22px;
    margin-bottom: 100px;
    background-color: red;
}


.apple-text {
    margin-bottom: 50px;
    font-size: 14px;
    background-color: rgb(227, 65, 64);
    color: white;
    text-align: center;
    padding-top: 18px;
    padding-bottom: 18px;
}


.span-example {
    color:red;
}

.span-example:hover{
    text-decoration: underline;
}

.shop-link {
    cursor: pointer;
}

.shop-link:hover{
    text-decoration: underline;
}
